import React from 'react'

export function AddTodo({ task, onChange, onSubmit }) {
    return (
        <section id="new-task">
            <form onSubmit={onSubmit}>
            <input 
                type="text" 
                id="input" 
                placeholder="What needs to be done?" 
                value={task}
                onChange={onChange}
            />
            <button type="submit" id="add-task">Add Task</button>
            </form>
        </section>
    )
}
